def findCommon(str1, str2):
    output = ""
    c1 = str1 if len(str1) < len(str2) else str2 # the one with shorter length
    c2 = str2 if c1==str1 else str1

    for i in range(len(c1)):
        t = c2.find(c1[i])
        if t!=-1:
            output+=c1[i]
            c2 = c2[:t] + c2[t+1:]
    return output




def commonChars(A: 'List[str]'):
    if len(A) ==0 or len(A) == 1 :
        output = ""
        for i in A:
            output+=i
        return output
    else:
        temp = findCommon(A[0], A[1])

        for i in range(2, len(A)):
            temp = findCommon(temp, A[i])

        output = []
        for j in temp:
            output.append(j)

        return output

